#include <stdio.h>
#include <stdlib.h>
#include <string.h>

typedef struct{
    char nama[50];
    int nilai;
}data;

int main(){
    int n;
    scanf(""%d"", &n);
    data arr[n];
    for(int i=0;i<n;i++){
        scanf(""%s %d"", &arr[i].nama, &arr[i].nilai);
    }
    int max = arr[0].nilai;
    int min = arr[0].nilai;
    int max_index = 0;
    int min_index = 0;
    for(int i=1;i<n;i++){
        if(arr[i].nilai > max){
            max = arr[i].nilai;
            max_index = i;
        }
        if(arr[i].nilai < min){
            min = arr[i].nilai;
            min_index = i;
        }
    }
    printf(""%s %d
"", arr[max_index].nama, arr[max_index].nilai);
    printf(""%s %d
"", arr[min_index].nama, arr[min_index].nilai);
    return 0;
}"

